private static boolean checkThatChangesAreUnderSvn(@Nullable Change[] changes) {
    boolean result = false;

    if (changes != null) {
      result = ContainerUtil.or(changes, new Condition<Change>() {
        @Override
        public boolean value(Change change) {
          return isUnderSvn(change.getBeforeRevision()) || isUnderSvn(change.getAfterRevision());
        }
      });
    }

    return result;
  }

@NotNull
  private static List<GrParametersOwner> findScopes(@NotNull InitialInfo initialInfo) {
    PsiElement place = initialInfo.getContext();
    final List<GrParametersOwner> scopes = new ArrayList<GrParametersOwner>();
    while (true) {
      final GrParametersOwner parent = PsiTreeUtil.getParentOfType(place, GrMethod.class, GrClosableBlock.class);
      if (parent == null) break;
      scopes.add(parent);
      place = parent;
    }
    return scopes;
  }

